  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This document presents summary information
  on the quality of health care received by Medicare beneficiaries, including information
  about their experiences as patients obtaining care. This quality of care data is
  presented at the national level, and is shown for different racial-ethnic groups.The
  specific measures reported fall into two categories (1) patient experience measures
  and (2) clinical care measures. This information may be of interest to Medicare
  beneficiaries, Medicare Advantage and prescription drug plans, and others interested
  in better understanding beneficiaries quality of care and how it differs across
  racial-ethnic groups.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
